import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams,
  useRouteMatch
} from "react-router-dom";

export default function NestingExample() {
  return (
    <Router>
      <div>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/topics">Topics</Link>
          </li>
        </ul>
        <hr />
        <Switch>
          <Route path="/:id" children={<Child />} />
            </Switch>
      </div>
    </Router>
    );
  }

  function Child(){
    let { id } = useParams();

    return(
      <div>
        <h3>ID: {id}</h3>
      </div>
    );
  }
